import "./App.css";
import Navbar from "./pages/Navbar";
import Popup from "./pages/Popup";
import Slider from "./pages/Slider";
import Banner from "./pages/Banner";

function App() {
  return (
    <div>
      <Navbar />
      <Popup />
      <Slider />
      <Banner />
    </div>
  );
}

export default App;
